import React from 'react';
import '../App.css';
import Background from '../images/Bookshelf.png';

class Home extends React.Component {

  render() {
    return (
        <div className="App">
          <header className="bg-danger text-center py-5 mb-4">
            <div className="container">
              <h1 className="font-weight-light text-white">Your Books</h1>
            </div>
          </header>
          <div style={{width: '100%', height: '50vh', backgroundImage: "url(" + Background + ")"}}>
            <h1> Welcome</h1>
          </div>
        </div>
       
    );
  }
}

export default Home;
